http://www.w3.org/2000/01/rdf-schema#com.value:
Osan Air Base est une base de l'United States Air Force en Corée du Sud située près de la ville d'Osan. Elle est l'une des trois grandes bases militaires de Pyongtek Son ouverture eut lieu en septembre 1951, en pleine guerre de Corée et les premiers avions arrivèrent en 1952. Début 2007, les principales unités présentes à Osan AB sont : 
* quartier général de la Seventh Air Force des Pacific Air Forces ; 
* 51st Fighter Wing.

